VALUES ('3175681231818', 'fourre myrtille', 'Edulcorant: maltitols, farine de blé 18%, ceuf, huile de colza 12%, fructooligosaccharides de chicorée, purée de myrtilles 10%, humectant : glycérol d\'origine végétale, stabilisant : sorbitols, amidon de blé, arômes naturels (contient alcool), poudres à lever (diphosphates, carbonates de sodium), sel de mer, correcteur d\'acidité: citrates de sodium, gélifiant : pectines, acidifiant: ácide citrique, jus concentré de raisin, concentré de carotte, épaississants (gomme xanthane, gomme guar). Fabriqué dans un atelier qui utilise du lait, des fruits à coque et du soja. Des cristaux blancs peuvent apparaître sous votre Gâteau Fourré. Ce phénomène est naturel et n\'altère nullement les qualités gustatives du produit. La garniture à la myrtille est incorporée par le dessus de votre Gâteau Fourré, ce qui peut laisser de légères marques à sa surface.', 'https://static.openfoodfacts.org/images/products/317/568/123/1818/front_fr.16.400.jpg', '11', '1.1', '62', '2', '', '4.1', '1', '0.393700787401575', '', '1');

